import './App.css';  

// import { useState } from 'react'
import NavBar from './components/NavBar/NavBar' 
import DummyData from './components/Data/DummyData'

function App() {   

  const data = DummyData

  return (
    <div className="App">
      <NavBar/> 
      {data.map((item) => 
        <p>{item['event'][0]}</p>
      )}
    </div>

  );
}

export default App;
